Witam, 



Mam do sprzedania auto Citroen C4 Picasso w bogatej wersji Exclusive, wyposażony w niezawodny silnik 2.0 HDi, który doskonale sprawdza się zarówno w warunkach miejskich, jak i podczas dłuższych tras. Przebieg samochodu to 329 000 km.



Samochód ma ważne ubezpieczenie OC do 05.2026 i wymieniony rozrząd.



Wnętrze to ciemna tapicerka, wyjątkowo praktyczna z punktu widzenia dzieci. 



Wyposażenie pojazdu obejmuje m.in.:



-sprawną klimatyzację automatyczną wielostrefową;

-oryginalne radio;

-dobrej jakości nagłośnienie;

-elektryczne szyby;

-elektryczne lusterka;

-zamek centralny;

-ESP;

-ABS;

-koło zapasowe;

-elektryczny hamulec ręczny;

-automatyczną skrzynię biegów;

-klimatyzowany schowek;

- za dopłatą, zestaw opon zimowych na stalowych felgach + możliwość zakupu relingów dachowych.



Auto wymaga drobnych poprawek lakierniczych w obszarze nadproży.

Sprzedam Seat Cordoba 1.4 LPG – 2002 r. – Auto sprawne



Na sprzedaż oferuję samochód Seat Cordoba z silnikiem 1.4 (60 KM) benzyna + LPG, rocznik 2002. Homologacja butli do 2028 roku. Samochód kupiony przeze mnie w salonie w Polsce w styczniu 2003.



Informacje podstawowe:

Silnik: 1.4 benzyna + instalacja LPG (ekonomiczne spalanie)



Rok produkcji: 2002

Przebieg: 256 tyś km

Skrzynia biegów: manualna



Stan techniczny:

Auto odpala bez problemu i dobrze się prowadzi jak na swoje lata, instalacja LPG działa bez zarzutu.

Zawieszenie, hamulce, oświetlenie – wszystko sprawne, wyświetla się jedynie błąd ciśnienia oleju (kontrolka gaśnie po chwili pracy silnika)



OC i przegląd ważne do stycznia 2026



Blacharka w dobrym stanie jak na wiek.



Wyposażenie:

Wspomaganie kierownicy;

Centralny zamek;

Radio dotykowe;

kamera cofania;

Elektryczne szyby (przód);

Poduszki powietrzne;

Koło zapasowe;

Ledy do jazdy w dzień;

brak klimatyzacji;



Cena: 2500 zł

Auto do obejrzenia w Warszawie, Bielany - Młociny.



Zapraszam do kontaktu.
